angular.module("drUtils",[]),angular.module("drUtils").service("drMath",function(){this.rangedNum=function(a,b,c){return Math.min(Math.max(a,b),c)},this.log=function(a,b){return Math.log(b)/Math.log(a)},this.positiveModulo=function(a,b){return(a%b+b)%b}});